import styled from "styled-components"

const WriteMessage = styled.TextInput.attrs(props => ({
    elevation: 5,
  }))`
    color: #111;
    background-color:#fff;
    margin:0px 10px 5px 10px;
    border-radius:10px;
    padding:10px;
`;

export default WriteMessage
